('2368','18','7883','Villa Winkler Nikki Mar',Null,'Moderne Neubauvilla in 1. Meereslinie im Südwesten Mallorcas','33335','Diese  Neubauvilla wird zurzeit auf einem 1.900m² großen 1. Meereslinie Grundstück erstellt. Die Luxusvilla bietet auf ca. 900m² Wohnfläche ein Licht durchflutetes Wohn-Esszimmer, moderne Einbauküche mit hochwertigen Marken Einbaugeräten, Hauswirtschafts- und Abstellräumen, 4 Schlafzimmer mit 4 Bädern en suite, Ankleide im Hauptschlafzimmer sowie sep. Gästeapartment. Die beiden Wohnetagen sind mit der Tiefgarage mit einem Lift verbunden. Auch die Tiefgarage (6 Stellplätze) erreicht man mit dem Auto über einen Carlift. Relaxen kann man am schicken Außenpool mit Liegeterrassen und Grillplatz. Hochwertige Technik sowie Klimaanlage und Fußbodenheizung schließen das Angebot ab.','33336','9500000','106','2015-08-31 10:27:41','106','2015-08-31 10:28:45',Null,'2455','105','956',1,'1','0',Null,Null,Null,'33337',Null,'0','0','0',Null,'2015-08-31 10:31:30',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33338',Null,'33339',Null,'33340',Null,'33341',Null,'33342','0',0,'0');
